/* global AFRAME */
/* global THREE */
/* global SVOX */

"use strict";

AFRAME.registerComponent('palms', {
  schema: {
   count: { default: 100 }          
  },
  init: function () {

    // Get the heightfield to place the palms at terrain level and the lightmap to draw the shadows
    const terrain = document.querySelector('[terrain]').components['terrain'];
    const heightField = terrain.heightField;                    
    const lightMap = terrain.lightMap;                    
    const ctxLight = lightMap.getContext('2d', { willReadFrequently:true });

    const worldToLight = lightMap.width / heightField.size;  
    const center     = heightField.size/2;

    // Draw the shadows on the light map. Grass uses the light map to darken in the shadow and
    // Will therefore be darker in the shadow of a palm tree
    ctxLight.save();

    // Begin path for all shadows
    ctxLight.beginPath();    
    ctxLight.filter = `blur(${this.worldToLight*1}px)`;

    // Add the palms to the object tracker to prevent overlapping of objects and for collision detection
    const objectTracker = this.el.sceneEl.systems['objecttracker'];

    // Create a lot of palms in the terrain
    let palms = "";
    for (let l = 0; l < this.data.count; l++) {
      let x = 0;
      let y = 0;
      let z = 0;

      // Generate locations, up to the maximum elevation with less palms higher up
      do {
        x = (Math.random() - 0.5) * heightField.size;
        z = (Math.random() - 0.5) * heightField.size;
        y = heightField.getHeight(x + center, z + center);
      } while((y > Math.random() * heightField.size * 0.005) ||
              objectTracker.getNearestObject(x,z,4))

      // Add this palm to the object tracker  
      objectTracker.addObject(x,z, 0.5);

      // Create a palm tree clone in Smooth Voxels
      palms += `group clone = Palm, scale = ${1 + Math.random()*0.5}, position = ${x} ${y} ${z}, rotation = 0 ${Math.random()*360} 0\n`;


      ctxLight.moveTo(worldToLight * (center + x), worldToLight * (center + z));
      ctxLight.arc(worldToLight * (center + x - 1.5), worldToLight * (center + z - 1.5), worldToLight * 3, 0, 2 * Math.PI, false);
    }      

    // Draw all shadows at once
    ctxLight.fillStyle = "rgba(0,0,0,0.5)";
    ctxLight.fill();

    ctxLight.restore();    

    // The Smooth Voxels model for all palm trees
    SVOX.models.Palms = `
      // Base64 image of a palm leaf
      texture id = palmleaf, size = 256 512, image = data:image/webp;base64,

      model
      size = 3 6 1
      scale = 1

      group id = Palm, origin = -y, prefab = true

      group group = Palm, id = Leaf, bendzy = 120 -4, origin = -y +z, scale = 0.75 0.5 0.5
      material type = basic, group = Leaf, hide = x y -z, side = double, deform = 1, map = palmleaf, maptransform = 3 6 0 0 0, transparent = true, alphatest = 0.5, alphatocoverage = true, fade = true
        colors = A:#020 B:#080 C:#FC0

      group group = Palm, clone = Leaf, rotation = 0  90 0, bendzy = 120 -4
      group group = Palm, clone = Leaf, rotation = 0 180 0, bendzy = 120 -4
      group group = Palm, clone = Leaf, rotation = 0 270 0, bendzy = 120 -4
      group group = Palm, clone = Leaf, rotation = 0  45 0, bendzy =  90 -6
      group group = Palm, clone = Leaf, rotation = 0 135 0, bendzy =  90 -6
      group group = Palm, clone = Leaf, rotation = 0 225 0, bendzy =  90 -6
      group group = Palm, clone = Leaf, rotation = 0 315 0, bendzy =  90 -6

      ${palms}

      voxels 
      AAA BBB BBB BBB CBC CCC
    `;    

    this.el.setAttribute('svox', 'model:Palms;');
    this.el.setAttribute('ambientlight', '');
  }
});   
